import React from 'react';
import Loader from './Loader.js';
import TextColorizer from './TextColorizer.js';

class Header extends React.Component {

    constructor(props) {
        super(props);
        this.company = this.props.company;
    }

    render() {
        return (
            <div className="App ">
                <div className="flexContainer header">
                <div className="flex3Column bg-green" />
                <div className="flex3Column bg-yellow" />
                <div className="flex3Column bg-red" />
                </div>
                <div class="width-100-percent white header mt-2 faded bg-dark p-10" onClick={siteNavClick}><button>Home</button> / <button>BowlBuilder</button> / <button>TempConverter</button> / <button>Essay</button> / <button>Reservation</button> / <button>GuestList</button> / <button>SurfLog</button></div>
                <header className="App-header">
                <Loader />
                <TextColorizer text={company}/>
                </header>
            </div>
        );
    };
}

export default Header;
